import React from "react";
import PropTypes from "prop-types";
import {Modal, Button} from "antd";

const ModalAntd = (props) => {
    return (
        <Modal
            title={props.title}
            visible={props.visible}
            width={props.width ? props.width : undefined}
            bodyStyle={props.bodyStyle ? props.bodyStyle : undefined}
            onOk={props.onOk}
            onCancel={props.onCancel}
            footer={!props.footer ? (
                <div className="modal-footer-ant">
                    <Button onClick={props.onCancel}>{props.cancelText ? props.cancelText : "Cancel"}</Button>
                    {props.okText ?
                        <Button loading={props.confirmLoading ? props.confirmLoading : false} onClick={props.onOk}
                                variant="contained"
                                color="primary" type="primary">{props.okText ? props.okText : "Submit"}</Button> : null}
                </div>
            ) : null}
            className={props.className}>
            {props.children}
        </Modal>
    );
};

ModalAntd.propTypes = {
    title: PropTypes.string.isRequired,
    className: PropTypes.string,
    visible: PropTypes.bool,
    onOk: PropTypes.func,
    onCancel: PropTypes.func,
    footer: PropTypes.node,
    children: PropTypes.node,
};

export default ModalAntd;
